import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
	return (
		<div class="home">
			<Link to="/login">Log In</Link>
			<br></br>
			<Link to="/signup">Sign Up</Link>
			<br></br>
		</div>
	);
};
export default Home;
